import todo from './../models/todo'
import classes from './TodoItem.module.css'

const Todo: React.FC<{todo: todo, onClick: (id: string) => void}> = (props) => {
	return (
		<li className={classes.item} key={props.todo.id} onClick={onClick} >{props.todo.text} </li>
	);
}

export default Todo;
